import React from "react";
import FullRecord from "./FullRecord";

const Address = (addr) => {
  return (
    <div>
      <div style={{ border: '1px solid rgba(0, 0, 150, 0.5)', margin: '10px' }}>
        <strong>Город: </strong> {addr.city}, <strong>улица:</strong> {addr.street}, <strong>дом:</strong> {addr.house}, <strong>квартира:</strong> {addr.office}
      </div>
      <div>
        {addr.full_records.map(rec =>
          <FullRecord rec={rec.full_records} key={rec.full_records.address.id} />
        )}
      </div>
    </div>
  );
};

export default Address;
